import { useState } from "react";
import Layout from "../components/layout/layout";
import Input from "../components/input";
import Button from "../components/button";

function Checkout() {
  const position = {
    container: "w-2/4 m-auto",
    button: "*:w-full *:py-4 mt-5",
    separator: "my-10",
  };
  const design = { separator: "bg-gray-200" };
  const [data, setData] = useState({});

  function onChange(e) {
    const { name, value } = e.target;
    setData((prev) => ({ ...prev, [name]: value }));
  }

  function onClick() {
    console.log(data);
  }

  return (
    <Layout>
      <div className={position.container}>
        <>
          <Title text="Delivery" />
          <Heading text="What's your name and address?" />
          <Input
            name="fname"
            value={data.fname}
            onChange={onChange}
            placeholder="First Name"
          />
          <Input
            name="lname"
            value={data.lname}
            onChange={onChange}
            placeholder="Last Name"
          />
          <Input
            name="address"
            value={data.address}
            onChange={onChange}
            placeholder="Address"
          />
          <Heading text="What's your contact information?" />
          <Input
            name="email"
            value={data.email}
            onChange={onChange}
            placeholder="Email"
          />
          <Input
            name="phone"
            value={data.phone}
            onChange={onChange}
            placeholder="Phone Number"
          />
          <div className={position.button}>
            <Button text="Continue" onClick={onClick} />
          </div>
          <hr className={`${position.separator} ${design.separator}`} />
        </>
        <>
          <Title text="Shipping" />
          <Heading text="When do you want the order?" />
          <Box text="Wed, May 29 - Sat, Jun 1" subtext="Free" />
          <Box text="Sat, Jun 1 - Tue, Jun 4" subtext="$50" />
          <div className={position.button}>
            <Button text="Continue" onClick={onClick} />
          </div>
          <hr className={`${position.separator} ${design.separator}`} />
        </>
      </div>
    </Layout>
  );
}

export default Checkout;

function Title(props) {
  const design = "font-medium text-xl text-gray-900";
  return <h3 className={design}>{props.text}</h3>;
}

function Heading(props) {
  const position = "mt-8";
  const design = "font-medium";
  return <h4 className={`${position} ${design}`}>{props.text}</h4>;
}

function Box(props) {
  const position = {
    container: "flex justify-between p-4 my-2 cursor-pointer",
  };
  const design = {
    container: "border border-2 rounded-xl hover:border-gray-700",
    subtext: "font-light text-gray-500",
  };

  return (
    <div className={`${position.container} ${design.container}`}>
      <p>{props.text}</p>
      {props.subtext && <p className={design.subtext}>{props.subtext}</p>}
    </div>
  );
}
